import React from 'react';
import { Link, NavLink, withRouter } from 'react-router-dom';

const Navbar = props => {

  return (
    <div className='ui large menu'>
      <Link to="/" className='item'>
        <h4 className='ui header'>
          <i className='wpexplorer icon'></i>
          <div className='content'>
          Traveller
          <div className='sub header'>Stress Less, Travel More</div>
          </div>
        </h4>
      </Link>
      <NavLink exact to="/trips" className='active item'>
        <h3 className='ui header'>My Trips</h3>
      </NavLink>
      <NavLink exact to="/trips" className='item'>
        <h3 className='ui header'>Signed-In as: Peter</h3>
      </NavLink>
      <NavLink exact to="/trips" className='item'>
        <h3 className='ui header'>Logout</h3>
      </NavLink>
    </div>
  );
};

const NavBarWithRouter = withRouter(Navbar);

export default NavBarWithRouter;
